import logo from './logo.svg';
import 'bulma/css/bulma.min.css';
import './App.css';
import {Heading, Icon} from 'react-bulma-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEllipsisV, faSlidersH } from '@fortawesome/free-solid-svg-icons';
import { useState, useEffect } from 'react';
import React from 'react';


function Header(props) {
  const style = {
    "paddingTop": "100px"
  }

  return (
    <div>
      <p style={style} className="title is-1">Gym Cal</p>
      <hr/>
    </div>
    );
}

class DayCard extends React.Component {
  render() {
    return (
      <div className="column">
        <div className="card day-card" card-background-color="lightcoral">
          <div className="day-card-content">
            <div className="card-day-header">
              <div className="card-day level-left">
                {this.props.day}
              </div>
            </div>
            <div className="card-main-content columns is-centered">
              <div className="workout-text"> L </div>
            </div>
            <div className="card-date-footer">
              {this.props.date}
            </div>
          </div>
        </div>
      </div>
      );
  }
}

class WeekRow extends React.Component {
  render() {
    return (
        <div className="columns is-spaced week-row">
          {this.props.days.map((value, index) => {return <DayCard date={value.date} day={value.day}/>})}
        </div>
      )
  }
}

class Calendar extends React.Component {
  render () {
    return (
      <div className="calendar">
        <WeekRow days={[{date: "30", day:"S"}, {date: "31", day:"M"}, {date: "9/1", day:"T"}, {date: "2", day:"W"}, {date: "3", day:"Th"}, {date: "4", day:"F"}, {date: "5", day:"F"}]}/>
        <WeekRow days={[{date: "9/1", day:"S"}, {date: "9/2", day:"M"}, {date: "9/3", day:"T"}, {date: "9/4", day:"W"}, {date: "9/5", day:"Th"}, {date: "9/6", day:"F"}, {date: "9/7", day:"F"}]}/>
        <WeekRow days={[{date: "9/1", day:"S"}, {date: "9/2", day:"M"}, {date: "9/3", day:"T"}, {date: "9/4", day:"W"}, {date: "9/5", day:"Th"}, {date: "9/6", day:"F"}, {date: "9/7", day:"F"}]}/>
      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <div className="container">
        {Header()}
        {<Calendar/>}
      </div>
    </div>
  );
}

export default App;
